  const iconOne = {
    loop: false,
    autoplay: true,
    prerender: true,
    animationData: logo
  };
  const iconTwo = {
    loop: true,
    autoplay: true,
    prerender: true,
    animationData: logo2
  };

  return (
    <div className="HomeBlocks">
      <div className="IconAndText">
        <div className="BlockIcon">
          <ReactBodymovin options={iconOne} />
        </div>
        <p>Mobile Apps</p>
      </div>

